def extract_FLAG(text):
    m = re.search(r"Congratulations! Challenge (\d) FLAG: (.+)\n", text)
    if m:
        return m.group(2)
    else:
        return None


def check_web_css_memo(host_name):
    if "http" not in host_name:
        host_name = "https://" + host_name

    try:
        r = requests.get(host_name, timeout=3)
        r.raise_for_status()
    except Exception:
        return 2

    flags = []

    try:
        url = urljoin(host_name, "chal/1")
        r = requests.post(
            url,
            data={"data": "hoge"},
            timeout=3,
        )
        r.raise_for_status()
        flag = extract_FLAG(r.text)
        if flag is not None:
            flags.append(flag)
        else:
            return 1

        url = urljoin(host_name, "chal/2")
        r = requests.post(
            url,
            data={"data": "hoge"},
            headers={"User-Agent": "Mozilla/5.0"},
            timeout=3,
        )
        r.raise_for_status()
        flag = extract_FLAG(r.text)
        if flag is not None:
            flags.append(flag)
        else:
            return 1

        url = urljoin(host_name, "chal/3")
        r = requests.post(
            url,
            json={"data": {"hoge": "fuga"}},
            timeout=3,
        )
        r.raise_for_status()
        flag = extract_FLAG(r.text)
        if flag is not None:
            flags.append(flag)
        else:
            return 1

        url = urljoin(host_name, "chal/4")
        r = requests.post(
            url,
            json={"hoge": 1, "fuga": None},
            timeout=3,
        )
        r.raise_for_status()
        flag = extract_FLAG(r.text)
        if flag is not None:
            flags.append(flag)
        else:
            return 1

        url = urljoin(host_name, "chal/5")
        r = requests.post(
            url,
            files={"data": png},
            timeout=3,
        )
        r.raise_for_status()
        flag = extract_FLAG(r.text)
        if flag is not None:
            flags.append(flag)
        else:
            return 1

        if "FLAG{y0u_ar3_http_p0st_m@ster!}" == f"FLAG{{{'_'.join(flags)}}}":
            return 0
        return 1

    except:
        return 1


